  throw new Error('–ù–µ –Ω–∞–π–¥–µ–Ω–æ –Ω–∏ –æ–¥–Ω–æ–≥–æ –≤–∞–ª–∏–¥–Ω–æ–≥–æ —Ñ–∏–ª–∏–∞–ª–∞ —Å —Ç–æ–∫–µ–Ω–æ–º');
