const response = $input.all()[0].json;
const token = response.token;
const branch = $input.all()[0].json.branch || $node['Loop Over Branches'].json.branch;

if (!token) {
  throw new Error(`–ù–µ –ø–æ–ª—É—á–µ–Ω —Ç–æ–∫–µ–Ω –¥–ª—è —Ñ–∏–ª–∏–∞–ª–∞: ${branch}`);
}

