// –ü–æ–ª—É—á–∞–µ–º –º–∞—Å—Å–∏–≤ –∞–≤—Ç–æ–º–æ–±–∏–ª–µ–π
let cars = [];
if (Array.isArray(response)) {
  cars = response;
} else if (response.data && Array.isArray(response.data)) {
  cars = response.data;
} else if (response.cars && Array.isArray(response.cars)) {
  cars = response.cars;
}

console.log(`üìÑ –°—Ç—Ä–∞–Ω–∏—Ü–∞ ${prevData.page}: –ø–æ–ª—É—á–µ–Ω–æ ${cars.length} –∞–≤—Ç–æ–º–æ–±–∏–ª–µ–π`);

