const allCars = [...(prevData.allCars || []), ...cars];

// –ü—Ä–æ–≤–µ—Ä—è–µ–º, –µ—Å—Ç—å –ª–∏ –µ—â–µ —Å—Ç—Ä–∞–Ω–∏—Ü—ã
const hasMore = cars.length === 20 && prevData.page < 1000;

if (hasMore) {
  console.log(`‚Üí –ü–µ—Ä–µ—Ö–æ–¥ –Ω–∞ —Å—Ç—Ä–∞–Ω–∏—Ü—É ${prevData.page + 1}`);
} else {
  console.log(`‚úì –ó–∞–≤–µ—Ä—à–µ–Ω–∞ –∑–∞–≥—Ä—É–∑–∫–∞ –¥–ª—è —Ñ–∏–ª–∏–∞–ª–∞ ${prevData.branch}: –≤—Å–µ–≥–æ ${allCars.length} –∞–≤—Ç–æ–º–æ–±–∏–ª–µ–π`);
}

return [{
  json: {
    branch: prevData.branch,
    token: prevData.token,
    page: prevData.page + 1,
    hasMore: hasMore,
    allCars: allCars,
    carsOnPage: cars.length
  }
}];

// –ü—Ä–µ–æ–±—Ä–∞–∑—É–µ–º –º–∞—Å—Å–∏–≤ –∞–≤—Ç–æ–º–æ–±–∏–ª–µ–π –≤ —Ñ–æ—Ä–º–∞—Ç –¥–ª—è –≤—Å—Ç–∞–≤–∫–∏ –≤ –ë–î
const data = $input.all()[0].json;
const branch = data.branch;
const allCars = data.allCars || [];

if (allCars.length === 0) {
  console.log(`‚ö†Ô∏è –ù–µ—Ç –∞–≤—Ç–æ–º–æ–±–∏–ª–µ–π –¥–ª—è —Ñ–∏–ª–∏–∞–ª–∞ ${branch}`);
  return [{
    json: {
      branch: branch,
      totalCars: 0,
      carsToInsert: []
    }
  }];
}

console.log(`üîÑ –ü–æ–¥–≥–æ—Ç–æ–≤–∫–∞ ${allCars.length} –∞–≤—Ç–æ–º–æ–±–∏–ª–µ–π –¥–ª—è upsert (—Ñ–∏–ª–∏–∞–ª: ${branch})`);

// –ü–æ–ª—É—á–∞–µ–º branch_id –∏–∑ —Ç–∞–±–ª–∏—Ü—ã branches –ø–æ code
const branchMapping = {
