  'batumi': null,
  'kutaisi': null,
  'service-center': null
};

const carsToInsert = allCars.map(car => {
  const rentprogId = String(car.id);

  return {
    rentprog_id: rentprogId,
    branch_code: branch,
    plate: car.number || car.car_number || null,
    vin: car.vin || null,
    model: car.car_name || car.model || null,
    starline_id: car.starline_id || null,
    data: car  // –ü–æ–ª–Ω—ã–π JSON –æ–±—ä–µ–∫—Ç
  };
});

return [{
  json: {
    branch: branch,
    totalCars: allCars.length,
    carsToInsert: carsToInsert
  }
}];

// –ì–µ–Ω–µ—Ä–∞—Ü–∏—è SQL –¥–ª—è batch upsert –∞–≤—Ç–æ–º–æ–±–∏–ª–µ–π
const data = $input.all()[0].json;
const branch = data.branch;
const carsToInsert = data.carsToInsert || [];

if (carsToInsert.length === 0) {
  return [{
    json: {
      branch: branch,
      sql: '',
      carsCount: 0
    }
  }];
}

// –°–æ–∑–¥–∞–µ–º VALUES –¥–ª—è batch insert
const values = carsToInsert.map(car => {
  const plate = car.plate ? `'${car.plate.replace(/'/g, "''")}'` : 'NULL';
  const vin = car.vin ? `'${car.vin.replace(/'/g, "''")}'` : 'NULL';
  const model = car.model ? `'${car.model.replace(/'/g, "''")}'` : 'NULL';
  const starlineId = car.starline_id ? `'${car.starline_id.replace(/'/g, "''")}'` : 'NULL';
  const dataJson = JSON.stringify(car.data).replace(/'/g, "''");

  return `(
    gen_random_uuid(),
    (SELECT id FROM branches WHERE code = '${branch}'),
    ${plate},
    ${vin},
    ${model},
    ${starlineId},
    '${dataJson}'::jsonb,
    NOW(),
    NOW()
  )`;
}).join(',\n');

const sql = `
-- Batch upsert –∞–≤—Ç–æ–º–æ–±–∏–ª–µ–π –¥–ª—è —Ñ–∏–ª–∏–∞–ª–∞ ${branch}
INSERT INTO cars (
  id, branch_id, plate, vin, model, starline_id, data, created_at, updated_at
)
VALUES
${values}
ON CONFLICT (id) DO UPDATE SET
  branch_id = EXCLUDED.branch_id,
  plate = EXCLUDED.plate,
  vin = EXCLUDED.vin,
  model = EXCLUDED.model,
  starline_id = EXCLUDED.starline_id,
  data = EXCLUDED.data,
  updated_at = NOW()
RETURNING id, plate, model;
`;

return [{
  json: {
    branch: branch,
    sql: sql,
    carsCount: carsToInsert.length,
    carsData: carsToInsert
  }
}];

// –ì–µ–Ω–µ—Ä–∞—Ü–∏—è SQL –¥–ª—è upsert –≤ external_refs
const prevData = $node['Generate Upsert SQL'].json;
