const values = carsData.map(car => {
  const rentprogId = car.rentprog_id;
  const metaJson = JSON.stringify({ branch: branch, synced_at: new Date().toISOString() }).replace(/'/g, "''");

  return `(
    gen_random_uuid(),
    'car',
    (SELECT id FROM cars WHERE data->>'id' = '${rentprogId}' LIMIT 1),
    'rentprog',
    '${rentprogId}',
    '${branch}',
    '${metaJson}'::jsonb,
    NOW(),
    NOW()
  )`;
}).join(',\n');

const sql = `
-- Batch upsert external_refs –¥–ª—è –∞–≤—Ç–æ–º–æ–±–∏–ª–µ–π —Ñ–∏–ª–∏–∞–ª–∞ ${branch}
INSERT INTO external_refs (
  id, entity_type, entity_id, system, external_id, branch_code, meta, created_at, updated_at
)
VALUES
${values}
ON CONFLICT (system, external_id) DO UPDATE SET
  entity_id = EXCLUDED.entity_id,
  branch_code = EXCLUDED.branch_code,
  meta = EXCLUDED.meta,
  updated_at = NOW();
`;

return [{
  json: {
    branch: branch,
    sql: sql,
